import React from "react";
import NavDash from "../components/dashboard/NavDash";
import Main from "../components/dashboard/Main";

function Dashboard({ logout }) {
  return (
    <div>
      <header>
        <NavDash logout={logout} />
      </header>
      <main>
        <Main />
      </main>
      <footer></footer>
    </div>
  );
}

export default Dashboard;
